Ведущая, конферансье - Жанна Гагарина создает из праздников события с большой буквы.
Каждый праздник в её исполнении превращается в ожившую мечту о чуде. 
Высшее педагогическое образование, творческие навыки и способности и конечно обаяние являются составляющими её успеха. 

Проводит:
• Фестивали, благотворительные акции, вручение наград и премий;
• Городские праздники;
• Открытие учебных учреждений, компаний, площадок, магазинов;
• Гала - ужины;
• Корпоративные программы;
• Свадебные тожества;
• Дни Рождения и юбилеи;
Например: Открытие "Come On Gym" в ТРЦ Vegas Крокус Сити, Фестиваль "Вкусно & Полезно",  Фестиваль " 7 красок - загадочная Азия", корпоратив компании "Азбука Жилья",  вручение премии  "Строитель года", розыгрыш "Hummer".

К каждому празднику ведущая Жанна Гагарина подходит с душевной теплотой и креативным подходом.
